import React from "react";
import classes from "./slidebar.module.css";
import OwlCarousel from "react-owl-carousel";
import "owl.carousel/dist/assets/owl.carousel.min.css";
import "owl.carousel/dist/assets/owl.theme.default.min.css";

import phoneImage from "../../assests/pexels-photo-214487.jpeg";
import watchImage from "../../assests/pexels-photo-437037.webp";
import laptopImage from "../../assests/pexels-photo-8774466.webp";

const Slidebar = () => {
  return (
    <div className={classes.slidebar}>
      <OwlCarousel className="owl-theme" item="3" autoPlay={true} nav dots loop>
        <div className={classes.slider}>
          <img src={phoneImage} alt="sliderImage" />
        </div>
        <div className={classes.slider}>
          <img src={watchImage} alt="sliderImage" />
        </div>
        <div className={classes.slider}>
          <img src={laptopImage} alt="sliderImage" />
        </div>
      </OwlCarousel>
    </div>
  );
};

export default Slidebar;
